import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";
import Box, { BoxSort, BoxDirection } from "../../molecules/Box";
import Title, { TitleSize, TitleWeight } from "../../atoms/Title";

const Board = () => {
  return (
    <>
      <Title size={TitleSize.xs} weight={TitleWeight.l} mar={[2, 0, 2, 2]}>
        게시판
      </Title>
      <Styled.TableContainer></Styled.TableContainer>
    </>
  );
};

export default Board;
